import React from "react";
import AliceCarousel from "react-alice-carousel";
import "react-alice-carousel/lib/alice-carousel.css";
import { blog } from "../data";
import { AiFillGithub } from "react-icons/ai";

export default function Other() {
  // Configure the AliceCarousel options
  const carouselOptions = {
    items: blog.map((val) => (
      <div key={val.id} className="carousel-item">
        <div className="appcolor">
          <div className="w-[100%] relative md:w-[30%] bg-[#4dc6db62] hover:-translate-y-5 duration-200 ease-in-out my-10 flex shadow-3xl rounded-lg flex-col items-center">
            <div className="gap-20 m-5 text-[30px] flex flex-row">
              <a href="https://github.com/shivamkumarsha">
                <AiFillGithub />
              </a>
            </div>
            <h1 className="m-3 font-bold text-[25px]">
              <a href={val.gitlink}>{val.name}</a>
            </h1>
            <div className="flex m-3 gap-5 flex-col justify-between">
              <h1>{val.stack}</h1>
              <h1>{val.stack2}</h1>
              <a
                className="p-2 bg-white text-[black] rounded-2xl justify-center items-center flex"
                href={val.gitlink}
              >
                Git Link
              </a>
            </div>
            <img
              className="absolute h-[40px] top-10 rotate-45 left-0"
              src="https://altusimpact.com/wp-content/uploads/2020/05/white-leaf.png"
              alt="leaf"
            ></img>
          </div>
        </div>
      </div>
    )),
  };

  return (
    <div className="max-w-[1100px] md:p-0 p-5 mx-auto h-[auto] my-10 md:h-[90vh]">
      <h1 className="text-[40px] text-white my-20">Other works</h1>
      <AliceCarousel {...carouselOptions} />
    </div>
  );
}
